import React from "react"


export type Props = {
  name: string,
  onClick: () => void
}

const ChoosingCard: React.FC<Props> = ({name, onClick}) => {
    return (
        <div className="choosing-card" onClick={(name) => onClick(name)}>
            {name}
        </div>
    )
}

export default ChoosingCard
